#include <iostream>
#include <chrono>
#include <math.h>
using namespace std;

class Timer{
private:
    std::chrono::time_point<std::chrono::system_clock> m_StartTime;
    std::chrono::time_point<std::chrono::system_clock> m_EndTime;
public:
    void start(){
        m_StartTime = std::chrono::system_clock::now();
    }
    void stop(){
        m_EndTime = std::chrono::system_clock::now();
    }
    int elapsedTime_ms(){
        return std::chrono::duration_cast<std::chrono::milliseconds>(m_EndTime - m_StartTime).count();
    }
};

struct Node{
    int data;
    Node* next;
};

class LinkedList{
private:
    Node* head;
    Node* tail;
public:
    void insert_last(int val){
        Node *p = new Node;
        p->data = val;
        p->next = NULL;

        if(head == NULL){
            head = p;
            tail = p;
        }else{
            tail->next = p;
            tail = p;
        }
    }
    void delete_list(){
        while(head != NULL){
            Node* p = head;
            head = head->next;
            delete p;
        }
        tail = NULL;
    }
    void print(){
        Node *p = head;
        while(p != NULL){
            cout << p->data << endl;
            p = p->next;
        }
    }
    Node* getHead(){
        return head;
    }
    LinkedList(){
        head = NULL;
        tail = NULL;
    }
    ~LinkedList(){
        delete_list();
    }
};

void sort_func(int arr[], int arrSize, int control_digit){
    LinkedList linkedlist[10];
    int digit_val,c=0;
    for(int i=0;i<arrSize;i++){
        digit_val = (arr[i] / (int)(pow(10,control_digit) + 0.5)) % 10;
        linkedlist[digit_val].insert_last(arr[i]);
    }
    for(int i=0;i<10;i++){
        Node* p = linkedlist[i].getHead();
        while(p != NULL){
            arr[c++] = p->data;
            p = p->next;
        }
        linkedlist[i].delete_list();
    }
}

void radixSort(int arr[], int arrSize){
    int max_val = arr[0];
    int num_of_digits = 0;
    for(int i=1;i<arrSize;i++){
        if(max_val < arr[i]){
            max_val = arr[i];
        }
    }
    while(max_val > 0){
        max_val /= 10;
        num_of_digits++;
    }
    for(int i=0;i<num_of_digits;i++){
        sort_func(arr,arrSize,i);
    }
}

